# TensorFlow and tf.keras
import tensorflow as tf
from tensorflow import keras

# Helper libraries
import numpy as np #library for math with arrays
import matplotlib.pyplot as plt #library for displaying data visually

"""![CollectData.png](data:image/png;base64,)

#Data

The data used will be from the MNIST Fasion Dataset. Unlike most datasets, the data is included with the Keras API from TensorFlow. This makes "collecting data" quite easy, for it can be loaded in in just two lines of python code.

[Fashion MNIST on Kaggle](https://www.kaggle.com/datasets/zalando-research/fashionmnist)
"""

fashion_mnist = keras.datasets.fashion_mnist  # load dataset

(train_images, train_labels), (test_images, test_labels) = fashion_mnist.load_data()  # split into tetsing and training

"""Included in Keras are other datasets, such as ones for:
- Digit classification
- Housing prices
- Audio commands

Let's take a preview of our data:
"""

print(train_images.shape) #gives the size of the tensors

train_images[0, 23, 23] #gives information about the grayscale value of a single pixel on an image

"""Our pixel values are between 0 and 255, 0 being black and 255 being white. This means we have a grayscale image as there are no color channels."""

train_labels[:10]  # let's have a look at the first 10 training labels

"""Our labels are integers ranging from 0 - 9. Each integer represents a specific article of clothing. 
For convenience sake, we need better labels than just integers.
We'll create an array of label names to indicate which is which.
"""

class_names = ['T-shirt/top', 'Trouser', 'Pullover', 'Dress', 'Coat',
               'Sandal', 'Shirt', 'Sneaker', 'Bag', 'Ankle boot']

"""Let's use matplot to take a look at what the images looks like:"""

plt.figure()
plt.imshow(train_images[1])
plt.colorbar()
plt.grid(False)
plt.show()

"""Although not required, matplot is a useful library to use in conjunction with TensorFlow development to provide better data visualization.

![PrepareData.png](data:image/png;base64,)

##Getting the Data Ready for Training
Depending on the intended model or the input data, data preprocessing is sometimes an intensive step. For this project, all it means is scaling down the pixel values to be between 0-1 for the sake of the model's calculations. This is done as shown:
"""

train_images = train_images / 255.0

test_images = test_images / 255.0 #scales down the gretscale values of both the training and testing images

"""##Another Example: 
[Voice Control Project](https://github.com/StephenLeshko/SpecialDelivery/blob/master/voice_control.py)

![ChooseModel.png](data:image/png;base64,)

##Options
- K Nearest Neighbors
- Neural Network
- Convolutional Neural Network
- Support vector machines

For this classifier, we will select a neural network to be the machine learning model.
"""

model = keras.Sequential([
    keras.layers.Flatten(input_shape=(28, 28)),  # input layer (1)
    keras.layers.Dense(128, activation='relu'),  # hidden layer (2)
    keras.layers.Dense(10, activation='softmax') # output layer (3)
])
#tensor reshaping is ocurring behind the scenes
print(model)

"""##About the Model

**Layer 1:** This is our input layer and it will consist of 784 neurons. We use the flatten layer with an input shape of (28,28) to denote that our input should come in in that shape. The flatten means that our layer will reshape the shape (28,28) array into a vector of 784 neurons so that each pixel will be associated with one neuron.

**Layer 2:** This is our first and only hidden layer. The *dense* denotes that this layer will be fully connected and each neuron from the previous layer connects to each neuron of this layer. It has 128 neurons and uses the rectify linear unit activation function.

**Layer 3:** This is our output later and is also a dense layer. It has 10 neurons that we will look at to determine our models output. Each neuron represnts the probabillity of a given image being one of the 10 different classes. 
The activation function *softmax* is used on this layer to calculate a probabillity distribution for each class. This means the value of any neuron in this layer will be between 0 and 1, where 1 represents a high probabillity of the image being that class.

##Compiling the Model
"""

model.compile(optimizer='adam',
              loss='sparse_categorical_crossentropy',
              metrics=['accuracy'])

"""This can be thought of as the final prep before training the model. Compiling the model gives it important information for how it will train the network.

![TrainModel.png](data:image/png;base64,)
"""

model.fit(train_images, train_labels, epochs=10)  # we pass the data, labels and epochs and watch the magic!

"""...its that easy...

**Epoch:** Parameter that defines the number of times that the learning algorithm will work through the entire training dataset

![TestModel.png](data:image/png;base64,)

Testing the model is an integral part to the process of building an effective machine learning model. Without testing, one cannot determine whether or the model is effective for all possible cases, or if it just got lucky on the training data.

The data was split earlier into both training and testing data. The testing data is the data the model was not trained on, but is used to gauge the effectiveness of the model. It also tells important information like whether or not it is overfit...
"""

test_loss, test_acc = model.evaluate(test_images,  test_labels, verbose=1) 

print('Test accuracy:', test_acc)

"""##Making Predictions
To make predictions on images, we just pass an array of the images 
"""

predictions = model.predict(test_images)

"""This method returns to us an array of predictions for each image we passed it. """

predictions[0]

"""If we wan't to get the value with the highest score we can use a useful function from numpy called ```argmax()```. This simply returns the index of the maximium value from a numpy array. """

np.argmax(predictions[0])

"""And we can check if this is correct by looking at the value of the cooresponding test label."""

test_labels[0]

COLOR = 'white'
